B.T_=new A.x("Durch jeden Aufruf einer der Einzelseiten dieser Internetseite, die durch den f\xfcr die Verarbeitung Verantwortlichen betrieben wird und auf welcher eine Instagram-Komponente (Insta-Button) integriert wurde, wird der Internetbrowser auf dem informationstechnologischen System der betroffenen Person automatisch durch die jeweilige Instagram-Komponente veranlasst, eine Darstellung der entsprechenden Komponente von Instagram herunterzuladen. Im Rahmen dieses technischen Verfahrens erh\xe4lt Instagram Kenntnis dar\xfcber, welche konkrete Unterseite unserer Internetseite durch die betroffene Person besucht wird.",null,null,null,null,null,null,null)
