B.Sj=new A.x('W\xe4hlt die betroffene Person w\xe4hrend des Bestellvorgangs in unserem Online-Shop als Zahlungsm\xf6glichkeit "PayPal" aus, werden automatisiert Daten der betroffenen Person an PayPal \xfcbermittelt. Mit der Auswahl dieser Zahlungsoption willigt die betroffene Person in die zur Zahlungsabwicklung erforderliche \xdcbermittlung personenbezogener Daten ein.',null,null,null,null,null,null,null)
B.SW=new A.x("Bei den an PayPal \xfcbermittelten personenbezogenen Daten handelt es sich in der Regel um Vorname, Nachname, Adresse, Email-Adresse, IP-Adresse, Telefonnummer, Mobiltelefonnummer oder andere Daten, die zur Zahlungsabwicklung notwendig sind. Zur Abwicklung des Kaufvertrages notwendig sind auch solche personenbezogenen Daten, die im Zusammenhang mit der jeweiligen Bestellung stehen.",null,null,null,null,null,null,null)
